import React, { useEffect, useState } from "react";

const Country = (props) => {
  const [name, setName] = useState("Canada");
  const [data, setData] = useState({});

  useEffect(() => {
    try {
      setName(props.location.props.name);
    } catch (err) {
      setName("Canada");
    }
    fetch("/country-graph-data?category=deaths&history=90&country=" + name)
      .then((res) => res.json())
      .then((Jsondata) => {
        setData(Jsondata);
      });
    //fetch data using name
  }, []);

  return (
    <div>
      <h1>Country: {name}</h1>
      <h1>{Jsondata}</h1>
    </div>
  );
};

export default Country;
